  function fetchAllFeeds(startIndex = 1) {
    const script = document.createElement("script");
    script.src = `https://www.blogger.com/feeds/${blogId}/posts/default?alt=json-in-script&callback=handleFeed&max-results=${maxPerRequest}&start-index=${startIndex}`;
    document.body.appendChild(script);
  }

  function handleFeed(json) {
    const entries = json.feed.entry || [];
    entries.forEach((entry, i) => {
      const link = entry.link.find(l => l.rel === "alternate")?.href || "#";
      const title = entry.title?.$t || `Post ${allPosts.length + 1}`;
      let thumb = "";

      if (entry.media$thumbnail) {
        thumb = entry.media$thumbnail.url.replace(/s72\-c/, 's1600');
      } else if (entry.content?.$t.includes("<img")) {
        const match = entry.content.$t.match(/<img[^>]+src="([^">]+)"/);
        if (match) thumb = match[1].replace(/s72\-c/, 's1600');
      }

      allPosts.push({ title, link, thumb });
    });

    const nextLink = json.feed.link.find(l => l.rel === "next");
    if (nextLink) {
      const nextStartIndex = getStartIndexFromUrl(nextLink.href);
      fetchAllFeeds(nextStartIndex);
    } else {
      buildFourLevelTree(allPosts);
    }
  }

  function getStartIndexFromUrl(url) {
    const match = url.match(/start-index=(\d+)/);
    return match ? parseInt(match[1]) : null;
  }

  function buildFourLevelTree(posts) {
    const container = document.getElementById("folderTree");
    container.innerHTML = "";

    const ul = document.createElement("ul");
    ul.classList.add("tree");

    const postsPerSubGroup = postsPerFolder * foldersPerSubGroup;
    const postsPerGroup = postsPerSubGroup * subGroupsPerGroup;
    const totalGroups = Math.ceil(posts.length / postsPerGroup);

    let groupCounter = 1;
    let subGroupCounter = 1;
    let folderCounter = 1;

    for (let g = 0; g < totalGroups; g++) {
      const groupName = `${groupLabels[g % groupLabels.length]}_${groupCounter++}`;
      const groupLi = createFolderItem(groupName);
      const groupUl = groupLi.querySelector("ul");

      for (let s = 0; s < subGroupsPerGroup; s++) {
        const subGroupName = `${subGroupLabels[s % subGroupLabels.length]}_${subGroupCounter++}`;
        const subGroupLi = createFolderItem(subGroupName);
        const subGroupUl = subGroupLi.querySelector("ul");

        for (let f = 0; f < foldersPerSubGroup; f++) {
          const folderIndex = ((g * subGroupsPerGroup + s) * foldersPerSubGroup) + f;
          const start = folderIndex * postsPerFolder;
          const end = start + postsPerFolder;
          const folderPosts = posts.slice(start, end);
          if (folderPosts.length === 0) continue;

          const folderName = `${folderLabels[f % folderLabels.length]}_${folderCounter++}`;
          const folderLi = createFolder(folderName, folderPosts);
          subGroupUl.appendChild(folderLi);
        }

        groupUl.appendChild(subGroupLi);
      }

      ul.appendChild(groupLi);
    }

    container.appendChild(ul);
  }

  function createFolderItem(name) {
    const li = document.createElement("li");
    li.textContent = name;
    li.classList.add("folder", "collapsed");

    const ul = document.createElement("ul");
    ul.classList.add("tree");
    li.appendChild(ul);

    li.addEventListener("click", function (e) {
      e.stopPropagation();
      li.classList.toggle("collapsed");
    });

    return li;
  }

  function createFolder(name, posts) {
    const li = document.createElement("li");
    li.textContent = name;
    li.classList.add("folder", "collapsed");

    const ul = document.createElement("ul");
    ul.classList.add("tree");

    posts.forEach(post => {
      const fileLi = document.createElement("li");
      fileLi.classList.add("file");

      const thumbWrapper = document.createElement("div");
      thumbWrapper.className = "thumb-wrapper";

      const altText = `anasstassiiss ${globalAltCounter++}`;

      const imgLink = document.createElement("a");
      imgLink.href = post.link;
      imgLink.target = "_blank";
      imgLink.rel = "noopener";

      const img = document.createElement("img");
      img.className = "thumb";
      img.loading = "lazy";
      img.alt = altText;
      img.src = post.thumb || "https://via.placeholder.com/800x450?text=No+Thumbnail";

      imgLink.appendChild(img);
      thumbWrapper.appendChild(imgLink);

      const titleLink = document.createElement("a");
      titleLink.href = post.link;
      titleLink.target = "_blank";
      titleLink.rel = "noopener";

      const h3 = document.createElement("h3");
      h3.textContent = post.title;
      titleLink.appendChild(h3);

      thumbWrapper.appendChild(titleLink);
      fileLi.appendChild(thumbWrapper);
      ul.appendChild(fileLi);
    });

    li.appendChild(ul);
    li.addEventListener("click", function (e) {
      e.stopPropagation();
      li.classList.toggle("collapsed");
    });

    return li;
  }

  document.addEventListener("click", function (e) {
    const target = e.target;
    if (target.closest("a")?.href && !target.closest("h3") && !target.closest("img")) {
      e.preventDefault();
      const url = target.closest("a").href;
      if (confirm("Do you want to download this file?")) {
        window.open(url, "_blank", "noopener");
      }
    }
  });

  fetchAllFeeds();
